import "./App.css";
import Navbar from "./components/Navbar.js";

import TextForm from "./components/TextForm.js";

function App() {
  return (
    <>
      <Navbar title="TextUtils" about="About Us" />
      <div className="container">
        <TextForm />
      </div>
    </>
  );
}

export default App;
